Creating a high-quality testing framework in Cypress that uses Docker, along with its capability to capture screenshots and save them, involves several steps. Below is a guide to help you set up such a framework. This guide assumes you have some familiarity with Cypress and Docker.

### Step 1: Set Up a New Project Directory

First, create a new directory for your project and navigate into it:

```bash
mkdir cypress-screenshot-tester
cd cypress-screenshot-tester
```

### Step 2: Create Dockerfile

Create a Dockerfile in the `Cypress-screenshot-tester` directory. This file will define the environment in which your Cypress test will run.

```dockerfile
# Use an official Node.js runtime as a parent image
FROM node:14

# Set the working directory in the container
WORKDIR /usr/src/app

# Copy the current directory contents into the container at /usr/src/app
COPY..

# Install necessary dependencies
RUN npm install

# Make port 80 available to the world outside this container
EXPOSE 80

# Run the app
CMD ["cypress", "test"]
```

### Step 3: Create the Cypress Script

Create a `cypress` script file named `cypress.screenshot.js` in the `Cypress-screenshot-tester` directory. This script will capture and save screenshots during your Cypress tests.

```javascript
